import React from 'react';
import './image.css';
import { useState } from 'react';

const image = (props) => {
    const[style,setstyle]=useState("basic")

    const handledelete = () =>{
        props.setoption(0);
    }

    const handlerotate = () => {
        props.setoption("rotate")
    }
  return (
    <div className='fullcontainer'>
    <div className='img'>
     <img className={style} src={props.imgaddress}/>
     <div className='btnn'>
     <button onClick={handlerotate}>Rotate</button> 
     <button>Crop</button>
     <button>Contrast</button>
     <button>brightness</button>
     <button onClick={handledelete}>Delete</button>
     </div>
     <div className='btn'><button>Keep Scanning</button> <button className='pdfbtn'>Save PDF</button></div>
    </div>
    
    </div>
  )
}

export default image
